import React from "react";
import './header.css';
import { Link } from "react-router-dom";
function Header (){

    return(
        <div>
           <header>
            <nav>
                <div className="name">CARLOS HENRIQUE PIZZI</div>
                    <ul id="menu-h">
                        
                    <li>HOME</li>
                        
                    <li>PROJETOS</li>

                    <a href="#01"><li>SOBRE MIM</li></a>

                    <li>CONTATOS</li>

                    </ul>
            </nav>
           </header>

        </div>
    )
}

export default Header
